pub enum LoxError {
    Error {
            line: usize,
            message: String,
        },
    ParseError {
            token: Token,
            message: String,
        },
    RuntimeError {
            operator: Token,
            message: String,
        },
    Null,
}

pub enum Stmt {
    Block(Rc<BlockStmt>),
    Expression(Rc<ExpressionStmt>),
    Print(Rc<PrintStmt>),
    Var(Rc<VarStmt>),
}
